package org.mygov.covdashboard.model;import lombok.*;import javax.persistence.*;import java.time.LocalDate;@Getter@Setter@Entity(name = "Dashboard")@Builder@NoArgsConstructor@AllArgsConstructorpublic class DashboardEntity {	@Id	@GeneratedValue(strategy = GenerationType.AUTO)	@Column(name = "id", nullable = false)	private Long id;	private String countryRegion;	private String provinceState;	private LocalDate lastUpdate;	private Integer confirmedCases;	private Integer noOfDeaths;	private Integer recoveredCases;	private Integer activeCases;}